import Link from 'next/link';

const Index = () => ( // Implicit return everything in arrow function
  <div>
    <Link href='/about'>
      <a>About a Link</a>
    </Link>
    <Link href='/contact'>
      <a>Contact Page</a>
    </Link>
    <h1>Next.js Index Page</h1>
  </div>
);

export default Index;
